import React from 'react';
import '../Stylings/Calendar.css';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBackIosNew';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import {getYear, getMonth, getMonthNum, dayDisplay, priorMonthDays} from '../Calendar/DateFunctions.js';

class Calendar extends React.Component {
    render() {
        var year = getYear();
        var month = getMonth();
        var monthNum = getMonthNum();

        return (
            <div className="calendarContainer">
                <div className="calendarHeader">
                    <h1>{month} {year}</h1>
                    <button className="arrowBack"> <ArrowBackIosNewIcon /> </button>
                    <button className="arrowForward"> <ArrowForwardIosIcon /> </button>
                </div>

                <div className="daysDisplay">
                    <div className="weekDayDiv" id="day1Div">
                        <h5>Mon</h5>
                        {/*Todo: insert prior month days/future month days before and after (respectively) dayDisplay is called!*/}
                        {priorMonthDays(1, monthNum, year).map((num) => { 
                            return <h5>{num}</h5>;
                        })}
                        {dayDisplay(1).map((num) => {
                            return <h5>{num}</h5>;
                        })}
                    </div>
                    <div className="weekDayDiv" id="day2Div">
                        <h5>Tue</h5>
                        {priorMonthDays(2, monthNum, year).map((num) => { 
                            return <h5>{num}</h5>;
                        })}
                        {dayDisplay(2).map((num) => {
                            return <h5>{num}</h5>;
                        })}
                    </div>
                    <div className="weekDayDiv" id="day3Div">
                        <h5>Wed</h5>
                        {priorMonthDays(3, monthNum, year).map((num) => { 
                            return <h5>{num}</h5>;
                        })}
                        {dayDisplay(3).map((num) => {
                            return <h5>{num}</h5>;
                        })}
                    </div>
                    <div className="weekDayDiv" id="day4Div">
                        <h5>Thu</h5>
                        {priorMonthDays(4, monthNum, year).map((num) => { 
                            return <h5>{num}</h5>;
                        })}
                        {dayDisplay(4).map((num) => {
                            return <h5>{num}</h5>;
                        })}
                    </div>
                    <div className="weekDayDiv" id="day5Div">
                        <h5>Fri</h5>
                        {priorMonthDays(5, monthNum, year).map((num) => { 
                            return <h5 key={num}>{num}</h5>;
                        })}
                        {dayDisplay(5).map((num) => {
                            return <h5 key={num}>{num}</h5>;
                        })}
                    </div>
                    <div className="weekDayDiv" id="day6Div">
                        <h5>Sat</h5>
                        {priorMonthDays(6, monthNum, year).map((num) => { 
                            return <h5 key={num}>{num}</h5>;
                        })}
                        {dayDisplay(6).map((num) => {
                            return <h5 key={num}>{num}</h5>;
                        })}
                    </div>
                    <div className="weekDayDiv" id="day7Div">
                        <h5>Sun</h5>
                        {priorMonthDays(7, monthNum, year).map((num) => { 
                                return <h5 key={num}>{num}</h5>;
                            })}
                        {dayDisplay(7).map((num) => {
                            return <h5 key={num}>{num}</h5>;
                        })}
                    </div>
                </div>
            </div>
        );
    }
}

export {Calendar};
